import React from "react";
import Card from "../components/Card";
import LabelValue from "../components/LabelValue";

const Logout = () => {
  return (
    <div>
      <Card title="User Information">
        <LabelValue label="Name" value="John Doe" />
        <LabelValue label="Email" value="john.doe@example.com" />
        <LabelValue label="Phone" value="(123) 456-7890" />
        <LabelValue label="Address" value="123 Main St, Springfield" />
      </Card>

      <Card title="Settings">
        <LabelValue label="Language" value="English" />
        <LabelValue label="Timezone" value="UTC-5" />
      </Card>
    </div>
  );
};

export default Logout;
